import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import axios from "axios";
import { useForm, Controller } from "react-hook-form";
import MenuHeader from "../../../components/auth/MenuHeader";

import Avatar from "@mui/material/Avatar";
import Button from "@mui/material/Button";
import CssBaseline from "@mui/material/CssBaseline";
import TextField from "@mui/material/TextField";
import Box from "@mui/material/Box";
import PollIcon from "@mui/icons-material/Poll";
import Typography from "@mui/material/Typography";
import Container from "@mui/material/Container";
import { useTheme } from '@mui/material/styles';
import OutlinedInput from '@mui/material/OutlinedInput';
import MenuItem from '@mui/material/MenuItem';
import FormControl from '@mui/material/FormControl';
import Select from '@mui/material/Select';
import { createTheme, ThemeProvider } from "@mui/material/styles";

const theme = createTheme();




  

export default function SignIn() {






  const navigate = useNavigate();

  const [nameQuestion, setNameQuestion] = useState("");
  const [polls_id, setPolls_id] = useState("");
  const [polls, setPolls] = useState([]);
  const [validationError, setValidationError] = useState({});

  const handleChange = (event) => {
    setPolls_id(event.target.value);
  };

  useEffect(() => {
    getPolls();
  }, []);

    //Méthode pour récupérer les sondages
    const getPolls = async () => {
      await axios.get("http://localhost:8000/api/polls").then((res) => {
        setPolls(res.data);
      });
    };
  console.log(polls);

  //Fonction d'ajout d'une question
  const AddQuestion = async (e) => {
    e.preventDefault();

    const formData = new FormData();

    formData.append("nameQuestion", nameQuestion);
    formData.append("polls_id", polls_id);

    await axios
      .post(`http://localhost:8000/api/questions`, formData)
      .then(navigate("/dashboard/questions"))
      .catch(({ response }) => {
        if (response.status === 422) {
          setValidationError(response.data.errors);
        }
      });
  };

  return (
    <div>
      <MenuHeader />

      <ThemeProvider theme={theme}>
        <Container component="main" maxWidth="xs">
          <CssBaseline />
          <Box
            sx={{
              marginTop: 18,
              display: "flex",
              justifyContent: "center",
              flexDirection: "column",
              alignItems: "center",
            }}
          >
            {Object.keys(validationError).length > 0 && (
              <div className="row">
                <div className="col-12">
                  <div className="alert alert-danger">
                    <ul className="mb-0">
                      {Object.entries(validationError).map(([key, value]) => (
                        <li key={key}>{value}</li>
                      ))}
                    </ul>
                  </div>
                </div>
              </div>
            )}

            <Avatar sx={{ m: 1, bgcolor: "secondary.main" }}>
              <PollIcon />
            </Avatar>
            <Typography sx={{ mt: 0 }} component="h1" variant="h4">
              Créer une question
            </Typography>
            <Box component="form" onSubmit={AddQuestion} noValidate sx={{ mt: 3 }}>












            <FormControl sx={{ m: 1, width: 300, mt: 3 }}>
        <Select
          multiple
          displayEmpty
          value={personName}
          onChange={handleChange}
          input={<OutlinedInput />}
          renderValue={(selected) => {
            if (selected.length === 0) {
              return <em>Placeholder</em>;
            }

            return selected.join(', ');
          }}
          MenuProps={MenuProps}
          inputProps={{ 'aria-label': 'Without label' }}
        >
          <MenuItem disabled value="">
            <em>Placeholder</em>
          </MenuItem>
          {names.map((name) => (
            <MenuItem
              key={name}
              value={name}
              style={getStyles(name, personName, theme)}
            >
              {name}
            </MenuItem>
          ))}
        </Select>
      </FormControl>


















              <TextField
                margin="normal"
                required
                fullWidth
                id="email"
                label="Nom de la question"
                name="nameQuestion"
                autoComplete="email"
                autoFocus
                type="text"
                value={nameQuestion}
                onChange={(event) => {
                  setNameQuestion(event.target.value);
                }}
              />

              <Button
                type="submit"
                fullWidth
                variant="contained"
                sx={{ mt: 2, mb: 2 }}
              >
                Ajouter
              </Button>
            </Box>
          </Box>
        </Container>
      </ThemeProvider>
    </div>
  );
}
